class Solution:
    def sortVowels(self, s: str) -> str:
        vowels = ("a", "e", "i", "o", "u")
        vowel_data = []
        vowel_index = []
        for i in range(len(s)):
            if s[i].lower() in vowels:
                vowel_index.append(i)
                vowel_data.append(ord(s[i]))

        vowel_data.sort()
        count = 0
        ans = ""
        for i in range(len(s)):
            if i in vowel_index:
                ans += chr(vowel_data[count])
                count += 1
                continue
            ans += s[i]

        return ans

    def sortVowels2(self, s: str) -> str:
        vowels = ("a", "e", "i", "o", "u")
        vowel_data = []
        vowel_index = []
        for i, char in enumerate(s):
            if char.lower() in vowels:
                vowel_index.append(i)
                vowel_data.append(char)

        vowel_data.sort()
        lst = list(s)
        for index, vowel in zip(vowel_index, vowel_data):
            lst[index] = vowel

        return "".join(lst)


if __name__ == "__main__":
    s = Solution()
    inp = ""
